import React from 'react';
import './Body.css';
import logo4 from '../assets/logo4.jpg';
function Body() {
  return (
    <div className="body-container">
        <h2 className="body-heading">OUR PRODUCTS</h2>
      <div className="image-container">
      <img src={logo4} alt="" />
      </div>
      <div className="image-container">
      <img src={logo4} alt="" />
      </div>
      <div className="image-container">
      <img src={logo4} alt="" />
      </div>
    </div>
  );
}

export default Body;
